import React from 'react';
import Header from './Header';
import Hero from './Hero';
import Inspiration from './Inspiration';
import Discover from './Discover';
import Hosting from './Hosting';
import Footer from './Footer';

function App() {
  return (
    <div className="app">

      <Header />
      <Hero />
      <Inspiration />
      <Discover />
      <Hosting />
      <Footer />

    </div>
  );
}

export default App;
